  const Header = (props) => {
    return (
      <div>
        <p>
          <h1>{props.nimi}</h1>
        </p>
      </div>
    )
  }



  //content osat ja tehtävämäärä
  const Content = (props) => {
    return (
    <>
      <SubPart teksti={teksti1} nro={nro1}/>
      <SubPart teksti={teksti2} nro={nro2}/>
      <SubPart teksti={teksti3} nro={nro3}/>
    </>
    )
  }

  //total tehtävien yhteismäärä
  const Total = (props) => {
    return (
      <div>
        <p>
          Number of exercises {props.yhteensa}
        </p>
      </div>   
    )
  }

  //total tehtävien yhteismäärä
  const SubPart = (props) => {
    return (
      <div>
        <p>
          {props.teksti} {props.nro}
        </p>
      </div>   
    )
  }  



